drop table if exists friend_pair;

drop table if exists game;

drop table if exists rating_range;

drop table if exists user;

create table friend_pair
(
    id          int auto_increment
        primary key,
    sender_id   int        null,
    receiver_id int        null,
    accepted    tinyint(1) null
);

create table game
(
    id                  int auto_increment
        primary key,
    time                int        null,
    rated               tinyint(1) null,
    winner              varchar(1) null,
    black_rating        int        null,
    white_rating        int        null,
    black_id            int        null,
    white_id            int        null,
    history             text       null,
    played_date         bigint     null,
    black_rating_change int        null,
    white_rating_change int        null
);

create table rating_range
(
    id         int auto_increment
        primary key,
    min_rating int          null,
    win        int          null,
    loss       int          null,
    title      varchar(255) null
);

create table user
(
    id          int auto_increment
        primary key,
    role        varchar(50)  null,
    email       varchar(255) null,
    password    varchar(255) null,
    username    varchar(100) null,
    first_name  varchar(50)  null,
    last_name   varchar(50)  null,
    rating      int          null,
    profile_pic varchar(255) null
);

alter table friend_pair
    add constraint fk_receiver_id
        foreign key (receiver_id) references user (id)
            on update cascade on delete cascade;

alter table friend_pair
    add constraint fk_sender_id
        foreign key (sender_id) references user (id)
            on update cascade on delete cascade;

alter table game
    add constraint black_id
        foreign key (black_id) references user (id)
            on delete set null;

alter table game
    add constraint white_id
        foreign key (white_id) references user (id)
            on delete set null;





